import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-modal-permissao',
  templateUrl: './modal-permissao.page.html',
  styleUrls: ['./modal-permissao.page.scss'],
})
export class ModalPermissaoPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}

<ion-content [fullscreen]="true">
  <div id="header">
    <div id="app-bar">
      <ion-icon name="arrow-back-outline" style="color: black;"></ion-icon>
      <div id="logo">
        <img src="assets/icon/moio.png" alt="" />
      </div>
      <div></div>
    </div>
  </div>

  <div id="textPermissao">
    <h1>Nova Permissão</h1>
    <p>Registre funções na sua conta para facilitar a organização.</p>
  </div>

  <ion-button>Close</ion-button>
</ion-content>
